import { Navbar, Nav, NavDropdown, Dropdown } from 'react-bootstrap';
import AdminStyleSheet from '../style-sheets/adminStyleSheet';
import { DropdownButton } from 'react-bootstrap';


const AdminToolbar = () => (
  <div>
    <Navbar collapseOnSelect expand="lg" style={AdminStyleSheet.background} variant="dark">
      <Navbar.Brand href="/" className="mr-auto">Muhalik</Navbar.Brand>
      <Navbar.Brand href="#home" className="mr-auto">Admin Dashboard</Navbar.Brand>
      <nav>
        <DropdownButton title="Setting" style={{ color: 'white', background: 'none' }} id="basic-nav-dropdown" split alignRight>
          <div className="hover">
            <NavDropdown.Item href="#action/3.1">Acount Setting</NavDropdown.Item>
          </div>
          <div className="hover">
            <NavDropdown.Item href="#">Send Feedback</NavDropdown.Item>
          </div>
          <div className="spliter_hover">
            <NavDropdown.Item href="#a">Help?</NavDropdown.Item>
          </div>
          <NavDropdown.Divider />
          <div className="hover">
            <NavDropdown.Item href="#b">Signout</NavDropdown.Item>
          </div>
        </DropdownButton>
      </nav>
    </Navbar>
    <style jsx>
      {`
        .hover:hover {
          margin-left: 10px;
          margin-right: -10px;
          margin-bottom: 5px;
          margin-top: -5px;
          background: red;
        }        
        .spliter_hover:hover {
          margin-left: 10px;
          margin-right: -10px;
          margin-bottom: 13px;
          margin-top: -5px;
          background: red;
        }
        .dropdown {
          z-index: 200;
        }
        .nav {
          color: white;
        }
     `}
    </style>
  </div>
);

export default AdminToolbar;

{/* 563D7C E35300 */ }
